                                    <h3>Tweet</h3>
                                    <p>Tell the leaderdhip of the National Assembly to urge all members to prioritize... <a href="#">Read more</a></p>
                                    <button className="btn tweet">TWEET NOW</button>
                                </div>
                            </div>
                    </div>
            
         );
    }
}
 
export default LatestAction;
